import React from "react";
import { SnakeSquareType } from "../Types";
import Apple from "../icons/Apple";
import Banana from "../icons/Banana";
import Orange from "../icons/Orange";

interface SnakeSquareProps {
  square: SnakeSquareType;
}

function SnakeSquare({ square }: SnakeSquareProps) {
  var fruitNum = Math.ceil(Math.random() * 3);
  console.log(fruitNum);
  return (
    <div
      className={
        "Square" +
        (square.head ? " Head" : "") +
        (square.bodyPos > 0 ? " Body" : "") +
        (square.fruit ? " Fruit" : "")
      }
    >
      {fruitNum === 1 ? <Apple /> : <div></div>}
      {fruitNum === 2 ? <Banana /> : <div></div>}
      {fruitNum === 3 ? <Orange /> : <div></div>}
    </div>
  );
}

export default SnakeSquare;
